import React, { Component } from "react";
import SliderHome from "../common/slider/sliderHome.component";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import WhyChoose from "./whyChoose.component";
import Footer from "../common/footer/footer.component";
import computerCatsComponent from "../categories/computerCats.component";
import mobileCatsComponent from "../categories/mobileCats.component";
import featuredCatsComponent from "../categories/featuredCats.component";

// const imgURL = process.env.REACT_APP_IMG_URL;

export default class Landing extends Component {

  render() {
    return (
      <div className="">
        <SliderHome />
        <div className="container">
          {/* Featured Products */}
          <featuredCatsComponent />

          {/* Computer Accessories */}
          <computerCatsComponent />

          {/* MOBILE ACCESSORIES */}
          <mobileCatsComponent />
        </div>
        <WhyChoose />
        <Footer />
      </div>
    );
  }
}
